import React from 'react'

const ProductRow = React.memo(function ({name, price, index, addCart}) {
    return ( 
        <tr>
            <td>{name}</td>
            <td>{price}</td>
            <td><button onClick={() => addCart(index)}>panier</button></td>
        </tr>
    )
})

export default ProductRow;
